values:
so on wednesday beth tells me that she wants to take me to a place on thursday night and its a surprise... i'm thinking cool, that's so sweet, i'm glad she is taking initiative and thinking of nice things for us to do and so on and so forth... then i start thinking about it more and i kinda start freaking because i don't know where i'm going and she won't tell me anything except that i need to wear something nice and that she thinks&nbsp;that i will really like it... than i start thinking but we have only been dating for 6 weeks thats not that long and i don't know if she knows me well enough to pick a place she "knows" i will like.... this nonsensical thinking went on until thursday night&nbsp;

i arive more than a little weary at her house with dress pants, shirt and shoes in tow... we eat dinner and then change to go out to the mystery place... i have calmed some now because she has assured me so many times how much she think i'll like the place... and then i scare the shit out of her by telling her that i can't lie and that if i don't like it i will be unable to not show it... which is the truth but perhaps this was a bad time to reveal this tidbit

when we arrive at the place its a jazz bar called the Hip Kitty... i see it from a block away and instantly get excited because i have always wanted to got to a jazz bar... i love jazz music it i think is my favorite genre if i had to pick one... and to top it off&nbsp;their specialty is&nbsp;fondue.... so we&nbsp;walk in and instantly i am in love with this place, it is like stepping back in time and the music is phenominal... so we sat at a spot at the bar and had drinks and enjoyed the music and&nbsp;fed each other an assortment of chocolate goodies.... at that moment i was the happiest i have ever been in such a long time.... now don't get me wrong i have been very happy with beth and i enjoy all the time i have spent with her but this&nbsp;was the best time so far... and it was the most romantic thing&nbsp;anyone had ever done for me!

so i was proven wrong and all of my fears and freaking were totally unwarranted, and i now have a greater trust in beth and her ability to listen.... and this only allowed all my feelings for her&nbsp;to cement more.&nbsp;
